import React from "react";
import "./Vote.css";
function Vote() {
  return (
    <div className="vote">
      <div className="withdrawal">
        <h1>WITHDRAWAL REQUEST : RECONSTRUCTION</h1>
      </div>
      <div className="your-vote">
        <h1>YOUR VOTE</h1>
      </div>
      <div>
        <button className="vote-btns">APPROVE</button>
        <button className="vote-btns">REJECT</button>
      </div>
    </div>
  );
}
export default Vote;
